import { Link } from 'react-router-dom';
import dummyData from './dummy-data'


const TopicContainer = () => {

	return (
		<div>
			<Link to={/topics/}></Link>
			{dummyData.map((topic) => {
			return (
				<div>
					<h1>{topic.title}</h1>
      		<p>{topic.content}</p>
				</div>
			)})}
		</div>
	)
};

export default TopicContainer;
